  const { heading, highlights, content,image } = props;

  return (
      <Grid container>
        <Grid item xs={12} sm={6}>
          <Container sx={{ pt: 4, mx: 2 }}>
            <h3>{heading}</h3>
          </Container>
        </Grid>
        <Grid item xs={12} sm={6} sx={{ alignItems: 'center', justifyContent: 'center', display: 'flex' }}>
          <Container sx={{ py: 4 }}>
            <h3>{content}</h3>
          </Container>
        </Grid>
      </Grid>
  );
};

